import React from 'react'
import {Helmet} from "react-helmet";

const Head = () => {
    return (
        <div className="application">
            <Helmet>
                <meta charSet="utf-8" />
                <title>Andry Developer</title>
                <link rel="canonical" href="http://mysite.com/example" />
            </Helmet>
        </div>) 
};

export default Head;
